const DeleteListing = ({deleteListing})=>{
    return (
        <div>
            <a href="/" className="delete" onClick={(e)=>{
                e.preventDefault();
                const id = window.location.href.slice(-1);
                deleteListing(id);
            }}>Delete home</a>
            <style jsx>
                {`
                    .delete{
                        color: white;
                    }

                    .delete:link, .delete:active{
                        position: absolute;
                        top: 6rem;
                        right: 9rem;
                        display: inline-block;
                        text-decoration: none;
                        font-size: 1.5rem;
                        padding: .5rem 1rem;
                        background-color: red;
                    }
                `}
            </style>
        </div>
    )
}

export default DeleteListing;
